import React from 'react';
import TopNav from '../components/Navbar/TopNav';
import pedro from "../images/1.jpg";
import ShowPlants1 from '../components/ShowPlants1';
//import { useNavigate } from 'react-router-dom';
const Profile = () =>{
    //const navigate = useNavigate();
//
    //function profile() {
    //  navigate('/profile');
    //}
    return(
        <div className='full_div'>
            <TopNav />
            <center>
            <div style={{paddingLeft:'100px',marginTop:'50px'}}></div>
                <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '80%' }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '100%', margin: '0 auto' }}>
                        <div><button style={{  width:'100%',marginTop:'10px',marignLeft: '10px',backgroundColor: '#ff0000', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer' }}>LogOut</button>
                        <button className = "product-wrapper" style={{ backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize: '16px', borderRadius: '5px', border: 'none', cursor: 'pointer',marginTop:'5px' }}>Add plant to sell</button></div>
                        <div><img src={pedro} alt="Foto de Pedro" style={{marginLeft:'10px', width: '40%', height: '60%', objectFit: 'cover' }} /></div>
                        <div style={{ border: '2px solid green',padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '60%' }}>   
                            <div><h3>Name : José Moura</h3></div>
                            <div><h3>Location : Sintra, Portugal</h3></div>
                            <div><h3>About : Compro e vendo plantas!</h3></div>
                            <div>
                                <h3>Rating : </h3>
                                <input type="radio" id="star-5" name="rating" value="5"/>
                                <input type="radio" id="star-4" name="rating" value="4"/>
                                <input type="radio" id="star-3" name="rating" value="3" />
                                <input type="radio" id="star-2" name="rating" value="2"  />
                                <input type="radio" id="star-1" name="rating" value="1"  />
                            </div>
                        </div>
                    </div>
                    <div style={{ marginTop:'10px'}}><h2>Your plants for sale:</h2>
                        <ShowPlants1></ShowPlants1>
                    </div>
                    <div style={{ marginTop:'10px'}}><h2>Your last purchases:</h2>
                        <ShowPlants1></ShowPlants1>
                    </div>
                </div>
            </center>
            </div>

    );
}

export default Profile;
